VF_B='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/='

function VF_D(d) d = string.gsub(d, '[^'..VF_B..'=]', '') d = d:gsub('.', function(x) if x=='=' then return '' end r = VF_B:find(x)-1 b = '' for i=6,1,-1 do b = b .. ((r % 2 == 1) and '1' or '0'); r = math.floor(r/2) end return b end) d = d:gsub('%d%d%d%d%d%d%d%d', function(x) local c=0 for i=1,8 do c=c*2 + (x:sub(i,i) == '1' and 1 or 0) end return string.char(c) end) return d end

function VF_JOIN(tbl) local out = {} for i=1,#tbl do out[i]=VF_D(tbl[i]) end return table.concat(out) end
